import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Planificador = () => {
    const [data, setData] = useState([]);

    useEffect(() => {
        // Realizar la consulta a la API y actualizar el estado con los datos obtenidos
        axios.get('https://api.example.com/data')
            .then(response => {
                setData(response.data);
            })
            .catch(error => {
                console.error(error);
            });
    }, []);

    return (
        <div>
            <header className="bg-gray-800 text-white p-4">
                {/* Contenido del header */}
            </header>
            <div className="bg-gray-200 p-4">
                {/* Contenido del top */}
            </div>
            <div className="bg-white p-4">
                <table className="table-auto">
                    <thead>
                        <tr>
                            <th>Columna 1</th>
                            <th>Columna 2</th>
                            <th>Columna 3</th>
                        </tr>
                    </thead>
                    <tbody>
                        {data.map(item => (
                            <tr key={item.id}>
                                <td>{item.columna1}</td>
                                <td>{item.columna2}</td>
                                <td>{item.columna3}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default Planificador;
